	"com/techm/sustainabilityui/fragment/GRIStd.fragment.xml":'<core:FragmentDefinition xmlns="sap.m" xmlns:core="sap.ui.core" ><Dialog\t\t\n\t\txmlns="sap.m"\n\t\txmlns:core="sap.ui.core"\n        xmlns:t="sap.ui.table"\n        ><t:TreeTable id="GRIDialog" \n         selectionMode="Single"\n        enableColumnReordering="false"\n       \n        rows="{\n            path : \'Nodes>/\',\n            parameters : {\n                countMode: \'Inline\',\n                treeAnnotationProperties : {\n                    hierarchyLevelFor : \'HierarchyLevel\',\n                    hierarchyNodeFor : \'id\',\n                    hierarchyParentNodeFor : \'ParentNodeID\',\n                    hierarchyDrillStateFor : \'DrillState\'\n                }\n            }\n        }"\n          ariaLabelledBy="title" rowSelectionChange="onRowSelectionChange" ><t:extension><OverflowToolbar style="Clear"><Title id="title" text="GRI Standards"/><ToolbarSpacer/><Button text="Collapse all" press="onCollapseAll"/><Button text="Collapse selection" press="onCollapseSelection"/><Button text="Expand first level" press="onExpandFirstLevel"/><Button text="Expand selection" press="onExpandSelection"/><Button text="OK" press="onPressOkGRI"/><Button text="Cancel" press="onPressCancelGRI"/></OverflowToolbar></t:extension><t:columns><t:Column  hAlign="Center"><Label text="GRI"/><t:template><Text text="{Nodes>Description}" wrapping="false"/></t:template></t:Column></t:columns></t:TreeTable></Dialog></core:FragmentDefinition>',
	"com/techm/sustainabilityui/fragment/GRIStd1.fragment.xml":'<core:FragmentDefinition xmlns="sap.m" xmlns:core="sap.ui.core"><Dialog xmlns="sap.m" xmlns:core="sap.ui.core" xmlns:table="sap.ui.table" xmlns:plugins="sap.ui.table.plugins"><table:TreeTable\n            id="firstTabl"    class="plant1WTable"        \n            rows="{ path: \'/Standards_Module\',\n            \n            parameters: {   \n\t\t\t\t\t\t\texpand:\'toStandards_Module\', \n\t\t\t\t\t\t\tnavigation:{\'Standards_Module\': \'toStandards_Module\'},\n\t\t\t\t\t\t\t countMode: \'Inline\',\n\t\t\t\t\t\t\t treeAnnotationProperties : \n\t\t\t\t\t\t\t \t{\n\t\t\t\t\t\t\t\t\thierarchyLevelFor : \'HierarchyLevel\',\n\t\t\t\t\t\t\t\t\thierarchyNodeFor : \'id\',\n\t\t\t\t\t\t\t\t\thierarchyParentNodeFor : \'ParentNodeID\',\n\t\t\t\t\t\t\t\t\thierarchyDrillStateFor : \'DrillState\'\n                \t\t\t\t}\n                                }\n\t\t\t\t  }"\n        ><table:extension><OverflowToolbar style="Clear"><Title id="title" text="GRI Standards"/><ToolbarSpacer/><Button text="Collapse all" press="onCollapseAll"/><Button text="Collapse selection" press="onCollapseSelection"/><Button text="Expand first level" press="onExpandFirstLevel"/><Button text="Expand selection" press="onExpandSelection"/><Button text="OK" press="onPressOkGRI"/><Button text="Cancel" press="onPressCancelGRI"/></OverflowToolbar></table:extension><table:columns><table:Column label="GRI" ><table:template ><Text text="{Description}" wrapping="false"/></table:template></table:Column></table:columns></table:TreeTable></Dialog></core:FragmentDefinition>\n',
